    @Test
    public void test(){
        //定义数组
        String[] aArray = new String[5];
        String[] bArray = {"a","b","c", "d", "e"};
        String[] cArray = new String[]{"a","b","c","d","e"};
        System.out.println(bArray); //[Ljava.lang.String;@3d82c5f3 只是地址引用
        System.out.println(bArray.toString()); //也是错的
        for (String s : bArray) {
            System.out.println(s);
        }
        String s = Arrays.toString(bArray); //正确写法
        System.out.println(s);
    }
